def parse_tsv(filepath):
    """
    Parses a colors TSV and removes any country definitions.
    Returns a len=3 tuple:
        [0] the lines in the TSV which don't specify a country
        [1] index where the first country was defined (Last index in lines if no countries defined)
        [3] list of countries
    """
    lines = []
    existing_countries = []
    country_start_idx = None
    with open(filepath) as fh:
        for idx, line in enumerate(fh):
            if line.startswith("country\t"):
                if country_start_idx is None:
                    country_start_idx = idx
                existing_countries.append(line.split("\t")[1])
            else:
                lines.append(line)
    if country_start_idx is None:
        country_start_idx = len(lines)
    return lines, country_start_idx, existing_countries


